import React,{useEffect, useRef, useState} from 'react'
import Header from '../header'
import PatientListCard from '../patientListCard'
import SubHeader from '../subHeader'
import axios from 'axios'
import isEmpty from 'lodash/isEmpty'

import { useHistory } from "react-router-dom";

export default function PatientList() {

    const history = useHistory()

    const [startData, setStartData] = useState([])

    const doctor = JSON.parse(localStorage.getItem("doc")); 

    const token = doctor.token

    axios.defaults.headers.common["Authorization"] = `Bearer ${token}`;




    useEffect(()=>{
        setInterval(()=>{
            axios.get(`https://myplusdoctor.med2myhome.com/api/doctor/startdoctorconsult?doctor_id=${doctor.id}`)
            .then(res=>{
                setStartData([res.data])
            })
        },10000)
    },[])

    const handleStartConsult = _ => {
        const {patient_id, booking_id} = startData
         history.push("/consult", { patient_id, booking_id });
    }

    return (
        <>
            <div>
                <Header/>
                <SubHeader label={"Manage Patients"}   />

                <div className="d-flex  flex-column align-items-center">

                    <div className="fw-bold my-3 " style={{fontSize:"20px"}} >Welcome Doctor!</div>

                    <div className=" my-3 text-muted">{`Waiting List(${startData?.length})`}</div>

                    {startData?.map((key,i)=>(
                        <div className="card d-flex flex-row w-75 justify-content-between align-items-center p-2" key={i}>
                                <div>Patient 1</div>
                                <button className="btn btn-primary" onClick={handleStartConsult} >Start Consult</button>
                        </div>

                    ))}

                </div>
            </div>
        </>



    )

}
